export const riskLevelColorsAndIcons = (key) => {
  let color = "#7B808A";
  let icon =
    "data:image/png;base64,";

  if (key?.includes("High")) {
    color = "#F50808";
    icon =
      "data:image/png;base64,";
  } else if (key?.includes("Moderate")) {
    color = "#EFC205";
    icon =
      "data:image/png;base64,";
  } else if (key?.includes("Low")) {
    color = "#00C95C";
    icon =
      "data:image/png;base64,";
  } else if (key?.includes("Unable")) {
    color = "#7B808A";
    icon =
      "data:image/png;base64,";
  } else if (key?.includes("Pending")) {
    color = "#F50808";
    icon =
      "data:image/png;base64,";
  } else if (key?.includes("Reference_check_select")) {
    color = "#527afb";
    icon =
      "data:image/png;base64,";
  } else if (key?.includes("Reference_check_deselect")) {
    color = "#7B808A";
    icon =
      "data:image/png;base64,";
  }

  return { color, icon };
};
